import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      shouPageStart: <Users />,
    };
  }
  render() {
    return (
      <div>
        <div>
          <this.state.shouPageStart />
        </div>
      </div>
    );
  }
}

export default App;
